jssearch.files = {"1":{"u":".\/\/assets\/a44c75fa\/example.html","t":"Example","d":""},"2":{"u":".\/\/assets\/a44c75fa\/tests\/data\/other.html","t":"A completely different headline","d":"Lorem lorem lorem ipsum dolor sit amet, consetetur sadipscing elitr."},"3":{"u":".\/\/assets\/a44c75fa\/tests\/data\/simple.html","t":"This is an Example Page","d":"Lorem ipsum dolor sit amet, consetetur sadipscing elitr."},"4":{"u":".\/\/guide-en-caching-data.html","t":"Data Caching ","d":"Data caching is about storing some PHP variable in cache and retrieving it later from cache.\nIt is also the foundation for more advanced caching features, such as query caching\nand page caching."},"5":{"u":".\/\/guide-en-caching-fragment.html","t":"Fragment Caching ","d":"Fragment caching refers to caching a fragment of a Web page. For example, if a page displays a summary of\nyearly sale in a table, you can store this table in cache to eliminate the time needed to generate this table\nfor each request. Fragment caching is built on top of data caching."},"6":{"u":".\/\/guide-en-caching-http.html","t":"HTTP Caching ","d":"Besides server-side caching that we have described in the previous sections, Web applications may\nalso exploit client-side caching to save the time for generating and transmitting the same page content."},"7":{"u":".\/\/guide-en-caching-overview.html","t":"Caching ","d":"Caching is a cheap and effective way to improve the performance of a Web application. By storing relatively\nstatic data in cache and serving it from cache when requested, the application saves the time that would be\nrequired to generate the data from scratch every time."},"8":{"u":".\/\/guide-en-caching-page.html","t":"Page Caching ","d":"Page caching refers to caching the content of a whole page on the server side. Later when the same page\nis requested again, its content will be served from the cache instead of regenerating it from scratch."},"9":{"u":".\/\/guide-en-concept-aliases.html","t":"Aliases ","d":"Aliases are used to represent file paths or URLs so that you don't have to hard-code absolute paths or URLs in your project. An alias must start with the @ character to be differentiated from normal file paths and URLs. Yii has many pre-defined aliases already available. \nFor example, the alias @yii represents the installation path of the Yii framework; @web represents\nthe base URL for the currently running Web application."},"10":{"u":".\/\/guide-en-concept-autoloading.html","t":"Class Autoloading ","d":"Yii relies on the class autoloading mechanism\nto locate and include all required class files. It provides a high-performance class autoloader that is compliant to the\nPSR-4 standard.\nThe autoloader is installed when you include the Yii.php file."},"11":{"u":".\/\/guide-en-concept-behaviors.html","t":"Behaviors ","d":"Behaviors are instances of yii\\base\\Behavior, or of a child class. Behaviors, also known\nas mixins, allow you to enhance the functionality\nof an existing yii\\base\\Component class without needing to change the class's inheritance.\nAttaching a behavior to a component \"injects\" the behavior's methods and properties into the component, making those methods and properties accessible as if they were defined in the component class itself. Moreover, a behavior\ncan respond to the events triggered by the component, which allows behaviors to also customize the normal\ncode execution of the component."},"12":{"u":".\/\/guide-en-concept-components.html","t":"Components ","d":"Components are the main building blocks of Yii applications. Components are instances of yii\\base\\Component,\nor an extended class. The three main features that components provide to other classes are:"},"13":{"u":".\/\/guide-en-concept-configurations.html","t":"Configurations ","d":"Configurations are widely used in Yii when creating new objects or initializing existing objects. Configurations usually include the class name of the object being created, and a list of initial values\nthat should be assigned to the object's properties. Configurations may also include a list of\nhandlers that should be attached to the object's events and\/or a list of\nbehaviors that should also be attached to the object."},"14":{"u":".\/\/guide-en-concept-di-container.html","t":"Dependency Injection Container ","d":"A dependency injection (DI) container is an object that knows how to instantiate and configure objects and\nall their dependent objects. Martin's article has well\nexplained why DI container is useful. Here we will mainly explain the usage of the DI container provided by Yii."},"15":{"u":".\/\/guide-en-concept-events.html","t":"Events ","d":"Events allow you to inject custom code into existing code at certain execution points. You can attach custom\ncode to an event so that when the event is triggered, the code gets executed automatically. For example,\na mailer object may trigger a messageSent event when it successfully sends a message. If you want to keep\ntrack of the messages that are successfully sent, you could then simply attach the tracking code to the messageSent event."},"16":{"u":".\/\/guide-en-concept-properties.html","t":"Properties ","d":"In PHP, class member variables are also called properties. These variables are part of the class definition, and are used\nto represent the state of a class instance (i.e., to differentiate one instance of the class from another). In practice, you may often want to handle the reading or writing of properties in special ways. For example, you may want to always trim a string when it is being assigned\nto a label property. You could use the following code to achieve this task:"},"17":{"u":".\/\/guide-en-concept-service-locator.html","t":"Service Locator ","d":"A service locator is an object that knows how to provide all sorts of services (or components) that an application\nmight need. Within a service locator, each component exists as only a single instance, uniquely identified by an ID.\nYou use the ID to retrieve a component from the service locator."},"18":{"u":".\/\/guide-en-db-active-record.html","t":"Active Record ","d":"Note: This section is under development."},"19":{"u":".\/\/guide-en-db-dao.html","t":"Database basics ","d":"Note: This section is under development."},"20":{"u":".\/\/guide-en-db-migrations.html","t":"Database Migration ","d":"Note: This section is under development."},"21":{"u":".\/\/guide-en-db-query-builder.html","t":"Query Builder and Query ","d":"Note: This section is under development."},"22":{"u":".\/\/guide-en-glossary.html","t":"A ","d":"Alias is a string that's used by Yii to refer to the class or directory such as @app\/vendor."},"23":{"u":".\/\/guide-en-helper-overview.html","t":"Helpers ","d":"Note: This section is under development."},"24":{"u":".\/\/guide-en-input-file-upload.html","t":"Uploading Files ","d":"Note: This section is under development."},"25":{"u":".\/\/guide-en-input-forms.html","t":"Working with Forms ","d":"Note: This section is under development."},"26":{"u":".\/\/guide-en-input-validation.html","t":"Validating Input ","d":"As a rule of thumb, you should never trust the data received from end users and should always validate them\nbefore putting them to good use."},"27":{"u":".\/\/guide-en-intro-upgrade-from-v1.html","t":"Upgrading from Version 1.1 ","d":"There are many differences between versions 1.1 and 2.0 of Yii as the framework was completely rewritten for 2.0.\nAs a result, upgrading from version 1.1 is not as trivial as upgrading between minor versions. In this guide you'll\nfind the major differences between the two versions."},"28":{"u":".\/\/guide-en-intro-yii.html","t":"What is Yii ","d":"Yii is a high performance, component-based PHP framework for rapidly developing modern Web applications.\nThe name Yii (pronounced Yee or [ji:]) means \"simple and evolutionary\" in Chinese. It can also\nbe thought of as an acronym for Yes It Is!"},"29":{"u":".\/\/guide-en-output-client-scripts.html","t":"Working with Client Scripts ","d":"Note: This section is under development."},"30":{"u":".\/\/guide-en-output-data-providers.html","t":"Data providers ","d":"Note: This section is under development."},"31":{"u":".\/\/guide-en-output-data-widgets.html","t":"Data widgets ","d":"Note: This section is under development."},"32":{"u":".\/\/guide-en-output-formatter.html","t":"Data Formatter ","d":"For formatting of outputs Yii provides a formatter class to make data more readable for users.\nyii\\i18n\\Formatter is a helper class that is registered as an application component named formatter by default."},"33":{"u":".\/\/guide-en-output-theming.html","t":"Theming ","d":"Note: This section is under development."},"34":{"u":".\/\/guide-en-README.html","t":"The Definitive Guide to Yii 2.0 ","d":"This tutorial is released under the Terms of Yii Documentation."},"35":{"u":".\/\/guide-en-rest-authentication.html","t":"Authentication ","d":"Unlike Web applications, RESTful APIs are usually stateless, which means sessions or cookies should not\nbe used. Therefore, each request should come with some sort of authentication credentials because\nthe user authentication status may not be maintained by sessions or cookies. A common practice is\nto send a secret access token with each request to authenticate the user. Since an access token\ncan be used to uniquely identify and authenticate a user, API requests should always be sent\nvia HTTPS to prevent from man-in-the-middle (MitM) attacks."},"36":{"u":".\/\/guide-en-rest-controllers.html","t":"Controllers ","d":"After creating the resource classes and specifying how resource data should be formatted, the next thing\nto do is to create controller actions to expose the resources to end users through RESTful APIs."},"37":{"u":".\/\/guide-en-rest-error-handling.html","t":"Error Handling ","d":"When handling a RESTful API request, if there is an error in the user request or if something unexpected\nhappens on the server, you may simply throw an exception to notify the user that something went wrong.\nIf you can identify the cause of the error (e.g., the requested resource does not exist), you should\nconsider throwing an exception along with a proper HTTP status code (e.g., yii\\web\\NotFoundHttpException\nrepresents a 404 status code). Yii will send the response along with the corresponding HTTP status\ncode and text. Yii will also include the serialized representation of the\nexception in the response body. For example:"},"38":{"u":".\/\/guide-en-rest-quick-start.html","t":"Quick Start ","d":"Yii provides a whole set of tools to simplify the task of implementing RESTful Web Service APIs.\nIn particular, Yii supports the following features about RESTful APIs:"},"39":{"u":".\/\/guide-en-rest-rate-limiting.html","t":"Rate Limiting ","d":"To prevent abuse, you should consider adding rate limiting to your APIs. For example, you may want to limit the API usage\nof each user to be at most 100 API calls within a period of 10 minutes. If too many requests are received from a user\nwithin the stated period of the time, a response with status code 429 (meaning \"Too Many Requests\") should be returned."},"40":{"u":".\/\/guide-en-rest-resources.html","t":"Resources ","d":"RESTful APIs are all about accessing and manipulating resources. You may view resources as\nmodels in the MVC paradigm."},"41":{"u":".\/\/guide-en-rest-response-formatting.html","t":"Response Formatting ","d":"When handling a RESTful API request, an application usually takes the following steps that are related\nwith response formatting:"},"42":{"u":".\/\/guide-en-rest-routing.html","t":"Routing ","d":"With resource and controller classes ready, you can access the resources using the URL like\nhttp:\/\/localhost\/index.php?r=user\/create, similar to what you can do with normal Web applications."},"43":{"u":".\/\/guide-en-rest-versioning.html","t":"Versioning ","d":"A good API is versioned: changes and new features are implemented in new versions of the API instead of continually altering just one version. Unlike Web applications, with which you have full control of both the client-side and server-side\ncode, APIs are meant to be used by clients beyond your control. For this reason, backward\ncompatibility (BC) of the APIs should be maintained whenever possible. If a change that may break BC is necessary, you should introduce it in new version of the API, and bump up the version number. Existing clients can continue to use the old, working version of the API; and new or upgraded clients can get the new functionality in the new API version. "},"44":{"u":".\/\/guide-en-runtime-handling-errors.html","t":"Error Handling ","d":"Note: This section is under development."},"45":{"u":".\/\/guide-en-runtime-logging.html","t":"Logging ","d":"Note: This section is under development."},"46":{"u":".\/\/guide-en-runtime-url-handling.html","t":"URL Management ","d":"Note: This section is under development."},"47":{"u":".\/\/guide-en-security-authentication.html","t":"Authentication ","d":"Note: This section is under development."},"48":{"u":".\/\/guide-en-security-authorization.html","t":"Authorization ","d":"Note: This section is under development."},"49":{"u":".\/\/guide-en-security-passwords.html","t":"Security ","d":"Note: This section is under development."},"50":{"u":".\/\/guide-en-start-databases.html","t":"Working with Databases ","d":"This section will describe how to create a new page that displays country data fetched from\na database table named country. To achieve this goal, you will configure a database connection,\ncreate an Active Record class, and define an action,\nand create a view."},"51":{"u":".\/\/guide-en-start-forms.html","t":"Working with Forms ","d":"This section describes how to create a new page with a form for getting data from users.\nThe page will display a form with a name input field and an email input field.\nAfter getting those two pieces of information from the user, the page will echo the entered values back for confirmation."},"52":{"u":".\/\/guide-en-start-gii.html","t":"Generating Code with Gii ","d":"This section will describe how to use Gii to automatically generate  code\nthat implements some common Web site features. Using Gii to auto-generate code is simply a matter of entering the right information per to the instructions shown on the Gii Web pages."},"53":{"u":".\/\/guide-en-start-hello.html","t":"Saying Hello ","d":"This section describes how to create a new \"Hello\" page in your application.\nTo achieve this goal, you will create an action and\na view:"},"54":{"u":".\/\/guide-en-start-installation.html","t":"Installing Yii ","d":"You can install Yii in two ways, using Composer or by downloading an archive file.\nThe former is the preferred way, as it allows you to install new extensions or update Yii by simply running a single command."},"55":{"u":".\/\/guide-en-start-looking-ahead.html","t":"Looking Ahead ","d":"If you've read through the entire \"Getting Started\" section, you have now created a complete Yii application. In the process, you have learned how to implement some commonly\nneeded features, such as getting data from users via an HTML form, fetching data from a database, and\ndisplaying data in a paginated fashion. You have also learned how to use Gii to generate\ncode automatically. Using Gii for code generation turns the bulk of your Web development process into a task as simple as just filling out some forms. "},"56":{"u":".\/\/guide-en-start-workflow.html","t":"Running Applications ","d":"After installing Yii, you have a working Yii application that can be accessed via\nthe URL http:\/\/hostname\/basic\/web\/index.php or http:\/\/hostname\/index.php, depending\nupon your configuration. This section will introduce the application's built-in functionality,\nhow the code is organized, and how the application handles requests in general."},"57":{"u":".\/\/guide-en-structure-application-components.html","t":"Application Components ","d":"Applications are service locators. They host a set of the so-called\napplication components that provide different services for processing requests. For example,\nthe urlManager component is responsible for routing Web requests to appropriate controllers;\nthe db component provides DB-related services; and so on."},"58":{"u":".\/\/guide-en-structure-applications.html","t":"Applications ","d":"Applications are objects that govern the overall structure and lifecycle of Yii application systems.\nEach Yii application system contains a single application object which is created in\nthe entry script and is globally accessible through the expression \\Yii::$app."},"59":{"u":".\/\/guide-en-structure-assets.html","t":"Assets ","d":"An asset in Yii is a file that may be referenced in a Web page. It can be a CSS file, a JavaScript file, an image\nor video file, etc. Assets are located in Web-accessible directories and are directly served by Web servers."},"60":{"u":".\/\/guide-en-structure-controllers.html","t":"Controllers ","d":"Controllers are part of the MVC architecture.\nThey are objects of classes extending from yii\\base\\Controller and are responsible for processing requests and\ngenerating responses. In particular, after taking over the control from applications,\ncontrollers will analyze incoming request data, pass them to models, inject model results\ninto views, and finally generate outgoing responses."},"61":{"u":".\/\/guide-en-structure-entry-scripts.html","t":"Entry Scripts ","d":"Entry scripts are the first chain in the application bootstrapping process. An application (either\nWeb application or console application) has a single entry script. End users make requests to\nentry scripts which instantiate application instances and forward the requests to them."},"62":{"u":".\/\/guide-en-structure-extensions.html","t":"Extensions ","d":"Extensions are redistributable software packages specifically designed to be used in Yii applications and provide\nready-to-use features. For example, the yiisoft\/yii2-debug extension adds a handy debug toolbar\nat the bottom of every page in your application to help you more easily grasp how the pages are generated. You can\nuse extensions to accelerate your development process. You can also package your code as extensions to share with\nother people your great work."},"63":{"u":".\/\/guide-en-structure-filters.html","t":"Filters ","d":"Filters are objects that run before and\/or after controller actions. For example,\nan access control filter may run before actions to ensure that they are allowed to be accessed by particular end users;\na content compression filter may run after actions to compress the response content before sending them out to end users."},"64":{"u":".\/\/guide-en-structure-models.html","t":"Models ","d":"Models are part of the MVC architecture.\nThey are objects representing business data, rules and logic."},"65":{"u":".\/\/guide-en-structure-modules.html","t":"Modules ","d":"Modules are self-contained software units that consist of models, views,\ncontrollers, and other supporting components. End users can access the controllers\nof a module when it is installed in application. For these reasons, modules are\noften viewed as mini-applications. Modules differ from applications in that\nmodules cannot be deployed alone and must reside within applications."},"66":{"u":".\/\/guide-en-structure-overview.html","t":"Overview ","d":"Yii applications are organized according to the model-view-controller (MVC)\ndesign pattern. Models represent data, business logic and rules; views\nare output representation of models; and controllers take input and convert\nit to commands for models and views."},"67":{"u":".\/\/guide-en-structure-views.html","t":"Views ","d":"Views are part of the MVC architecture.\nThey are code responsible for presenting data to end users. In a Web application, views are usually created\nin terms of view templates which are PHP script files containing mainly HTML code and presentational PHP code.\nThey are managed by the yii\\web\\View application component which provides commonly used methods\nto facilitate view composition and rendering. For simplicity, we often call view templates or view template files\nas views."},"68":{"u":".\/\/guide-en-structure-widgets.html","t":"Widgets ","d":"Widgets are reusable building blocks used in views to create complex and configurable user\ninterface elements in an object-oriented fashion. For example, a date picker widget may generate a fancy date picker\nthat allows users to pick a date as their input. All you need to do is just to insert the code in a view\nlike the following:"},"69":{"u":".\/\/guide-en-test-acceptance.html","t":"Acceptance Tests ","d":"Note: This section is under development."},"70":{"u":".\/\/guide-en-test-environment-setup.html","t":"Testing environment setup ","d":"Note: This section is under development."},"71":{"u":".\/\/guide-en-test-fixtures.html","t":"Fixtures ","d":"Note: This section is under development."},"72":{"u":".\/\/guide-en-test-functional.html","t":"Functional Tests ","d":"Note: This section is under development."},"73":{"u":".\/\/guide-en-test-overview.html","t":"Testing ","d":"Testing is an important part of software development. Whether we are aware of it or not, we conduct testing continuously.\nFor example, when we write a class in PHP, we may debug it step by step or simply use echo or die statements to verify\nthat implementation works according to our initial plan. In case of web application we're entering some test data in forms\nto ensure the page interacts with us as expected. The testing process could be automated so that each time when we need\nto verify something, we just need to call up the code that do it for us. The code that verifies that result matches what\nwe've planned is called test and the process of its creation and further execution is known as automated testing, which\nis the main topic of testing chapters."},"74":{"u":".\/\/guide-en-test-unit.html","t":"Unit Tests ","d":"Note: This section is under development."},"75":{"u":".\/\/guide-en-tool-debugger.html","t":"Debug toolbar and debugger ","d":"Note: This section is under development."},"76":{"u":".\/\/guide-en-tool-gii.html","t":"The Gii code generation tool ","d":"Note: This section is under development."},"77":{"u":".\/\/guide-en-tutorial-advanced-app.html","t":"Advanced application template ","d":"Note: This section is under development."},"78":{"u":".\/\/guide-en-tutorial-console.html","t":"Console applications ","d":"Note: This section is under development."},"79":{"u":".\/\/guide-en-tutorial-core-validators.html","t":"Core Validators ","d":"Yii provides a set of commonly used core validators, found primarily under the yii\\validators namespace.\nInstead of using lengthy validator class names, you may use aliases to specify the use of these core\nvalidators. For example, you can use the alias required to refer to the yii\\validators\\RequiredValidator class:"},"80":{"u":".\/\/guide-en-tutorial-i18n.html","t":"Internationalization ","d":"Note: This section is under development."},"81":{"u":".\/\/guide-en-tutorial-mailing.html","t":"Mailing ","d":"Note: This section is under development."},"82":{"u":".\/\/guide-en-tutorial-performance-tuning.html","t":"Performance Tuning ","d":"Note: This section is under development."},"83":{"u":".\/\/guide-en-tutorial-start-from-scratch.html","t":"Creating your own Application structure ","d":"Note: This section is under development."},"84":{"u":".\/\/guide-en-tutorial-template-engines.html","t":"Using template engines ","d":"Note: This section is under development."},"85":{"u":".\/\/guide-en-tutorial-yii-integration.html","t":"Working with Third-Party Code ","d":"From time to time, you may need to use some third-party code in your Yii applications. Or you may want to\nuse Yii as a library in some third-party systems. In this section, we will show how to achieve these goals."},"86":{"u":".\/\/guide-en-widget-bootstrap.html","t":"Bootstrap Widgets ","d":"Note: This section is under development."},"87":{"u":".\/\/guide-en-widget-jui.html","t":"Jquery UI Widgets ","d":"Note: This section is under development."}};
jssearch.tokenizeString = function(string) {
		var stopWords = ["a","an","and","are","as","at","be","but","by","for","if","in","into","is","it","no","not","of","on","or","such","that","the","their","then","there","these","they","this","to","was","will","with","yii"];
		return string.split(/[\s\.,;\:\\\/\[\]\(\)\{\}]+/).map(function(val) {
			return val.toLowerCase();
		}).filter(function(val) {
			return !(val in stopWords);
		}).map(function(word) {
			return {t: word, w: 1};
		});
};